import "./App.css";
import { HashRouter, Routes, Route } from "react-router-dom";
import Layout from "./Pages/Layout";
import Home from "./Pages/Home";
import llista from "./Pages/llista";

function App() {
  return (
    <HashRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<Home />} />
          {llista.map(item)}
          <Route path="Comptador/Comptador" element={<Comptador />} />
          <Route path="Graella/Graella" element={<Graella />} />
        </Route>
      </Routes>
    </HashRouter>
  );
}
export default App;
